import "bootstrap/dist/css/bootstrap.min.css";
import './App.css';
import Navbar from './components/layouts/Navbar';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>        
          <Route exact path="/register" element={<Registration />} />
      </Routes>
    </div>
  );
}

export default App;
